import React from 'react';
import classes from'./About.module.css';
const About=()=>{
return(
    <React.Fragment>
  <header >
    <div class="container h-100">
      <div class="row h-100 align-items-center justify-content-center text-center">
        <div class="col-lg-10 align-self-end">
          <h1 class="text-uppercase text-white font-weight-bold">Support the community by offering voluntary services & support</h1>
          <hr />
        </div>
        <div >
          <p >Support the community by registering for volunteer work and donate the useful items to support !!</p>
          <a  href="#about">Find Out More</a>
        </div>
      </div>
    </div>
  </header>
  

    </React.Fragment>
)
}



export default About;
